  false,\n\t\"url\": null,\n\t\"notes\": \"In July 2011, a helicopter-based crew photographed
  approximately 180 miles of shoreline along the eastern edge of Norton Sound, from
  Cape Denbigh to south of Unalakleet, AK. During this flight 2,180 oblique aerial
